  qudt_Quantity:
    annotations:
      count: 588249
    class_uri: qudt:Quantity
    conforms_to: No schema conformance document specified
    description: "<p class=\"lm-para\">A <b>quantity</b> is the measurement of an\
      \ observable property of a particular object, event, or physical system. \r\u240A\
      \  A quantity is always associated with the context of measurement (i.e. the\
      \ thing measured, the measured value, the accuracy of measurement, etc.) whereas\
      \ the \r\u240A  underlying <b>quantity kind</b> is independent of any particular\
      \ measurement. Thus, length is a quantity kind while the height of a rocket\
      \ is a specific \r\u240A  quantity of length; its magnitude that may be expressed\
      \ in meters, feet, inches, etc. Examples of physical quantities include physical\
      \ constants, such as \r\u240A  the speed of light in a vacuum, Planck's constant,\
      \ the electric permittivity of free space, and the fine structure constant.\
      \ </p>\r\u240A<p class=\"lm-para\">In other words, quantities are quantifiable\
      \ aspects of the world, such as the duration of a movie, the distance between\
      \ two points, \r\u240Avelocity of a car, the pressure of the atmosphere, and\
      \ a person's weight; and units are used to describe their numerical measure.</p>\
      \ \r\u240A<p class=\"lm-para\">Many <b>quantity kinds</b> are related to each\
      \ other by various physical laws, and as a result, the associated units of some\
      \ quantity \r\u240Akinds can be expressed as products (or ratios) of powers\
      \ of other quantity kinds (e.g., momentum is mass times velocity and velocity\
      \ is defined as distance \r\u240Adivided by time). In this way, some quantities\
      \ can be calculated from other measured quantities using their associations\
      \ to the quantity kinds in these \r\u240Aexpressions. These quantity kind relationships\
      \ are also discussed in dimensional analysis. Those that cannot be so expressed\
      \ can be regarded \r\u240Aas \"fundamental\" in this sense.</p>\r\u240A<p class=\"\
      lm-para\">A quantity is distinguished from a \"quantity kind\" in that the former\
      \ carries a value and the latter is a type specifier.</p>"
